import React from 'react';

export const JournalEntry = () => {
    return (
        <div>
            <div className="journal__entry">

                <div
                    className="journal__entry-picture"
                    style={{
                        backgroundSize: 'cover',
                        backgroundImage: 'url(https://images.unsplash.com/photo-1579546929662-711aa81148cf?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxleHBsb3JlLWZlZWR8Mnx8fGVufDB8fHx8&w=1000&q=80)'
                    }}
                >

                </div>

            </div>
        </div>
    )
}
